process_htk_mgmt_options (){
   while getopts ":l:U:u:i" OPTION ;do
      case $OPTION in
         i) htk_install ;;
         l) MLST=$OPTARG ;;
         U|u) USR=$OPTARG ;;
         *)
            cON
            case $@ in
               -v|--vers*) show_htk_version ; exit ;;
               -*help*|-*usag*)
                  if [ $# -gt 1 ];then
                    less -p $2 $DOCDIR/usage.txt
                  elif [ $# -eq 1 ];then
                    if [ ! -e  $DOCDIR/usage.txt ];then
                       show_pre_help
                    else
                       less -p $MNAM $DOCDIR/usage.txt
                    fi
                  fi
                  exit
                  ;;
               *-browse*) payload_browser $2 ; exit ;;
               *-extract*) payload_extractor $2 ; exit ;;
               --reconstruct-source-code) make_source_from_htk ; exit ;;
               --full-auto-install-upg) FULLAUTO=yes ; mupg ; exit ;;
               --full-auto-uninstall)
                  g.uninstall_grouper
                  c.uninstall_cluster_tools.sh
                  munst
                  exit
                  ;;
               --full-auto-complete-hyperf-purge)
                  completely_purge_hyperf_from_system
                  exit
                  ;;
               *-inst*) htk_install ; exit ;;
               -*upg*) mupg ; exit ;;
               *-uninst*)
                  echo "Are you sure you want to uninstall the HyPerf framework?"
                  echo
                  echo -n "[n]  "
                  read THSBL
                  test -z $THSBL 2>/dev/null && THSBL=n
                  case $THSBL in
                     y*|sure|ok|do\ it*|go*) munst ; exit ;;
                     *) echo Exiting without uninstallation... ;;
                  esac
                  exit
               ;;
            esac
            cOFF
         ;;
      esac
   done
   shift $(($OPTIND-1))
   CMD_LN=$@
   SRC=$1
   DST=$2
}
munst (){
   echo "---------------------------"
   echo "REMOVING LINKS IN $IDIR"
   echo "---------------------------"
   cd $IDIR
   find -samefile $MVL |grep -v $(basename $MVL) |xargs -i rm {}
   echo "--------------------------------------------"
   echo "         -------"
   echo "REMOVING EXECUTE BIT FROM $MVL"
   echo "         -------"
   echo "--------------------------------------------"
   echo "=============================="
   echo "HYPERF UNINSTALLATION COMPLETE"
   echo "=============================="
   chmod -x $MVL
